import React from "react";
import Store from "./Store";

const objs = [
  {id:0,src:'img/1.jpg',desc:'Nashoba Casual Composite Toe Work Boot',price:160,color:'Turkish Coffee Full-Grain Leather'},
  {id:1,src:'img/2.jpg',desc:'Timberland® Premium 6-Inch Waterproof Boots',price:210,color:'Wheat Nubuck'},
  {id:2,src:'img/3.jpg',desc:'Timberland® Premium 6-Inch Waterproof Boots',price:210,color:'Black Nubuck'},
  {id:3,src:'img/4.jpg',desc:'Ridgework Composite Toe Waterproof Work Boot',price:135,color:'Black Ever-Guard'},
  {id:4,src:'img/6.jpg',desc:'GreenStride™ Ray City Chelsea Boots',price:160,color:'Light Taupe Nubuck'},
  {id:6,src:'img/7.jpg',desc:'Paint Splash 6-Inch Waterproof Boots',price:240,color:'Wheat Nubuck'},
  {id:7,src:'img/8.jpg',desc:'Euro Hiker Boots',price:130,color:'Black Smooth'},
  {id:8,src:'img/9.jpg',desc:'Direct Attach 6" Steel Toe Waterproof Work Boot',price:145,color:'Wheat Nubuck'},
  {id:9,src:'img/10.jpg',desc:'Cortina Valley Chelsea Boots',price:160,color:'Black Full-Grain'},
  {id:10,src:'img/11.jpg',desc:'Timberland® Premium 6-Inch Waterproof Boots',price:170,color:'Black Nubuck'},
];


function App() {
  const links = ['Home', 'Products','About', 'Contact']
  return(
    <div className="container">
      <Store objs={objs} nav={links}/>
    </div>
  )
}

export default App;
